import './App.css';


const PHOTOS = [
  {
    image: "./public/photos/20th.jpg"
  }
]

function App() {

  return (
    <div className="App">
      <h1>this is my gallery</h1>
      <Gallery view={PHOTOS} />
    </div>
  );
}

export default App;
